import React from 'react';
import Project from '../Project/Project'

const projectListStyles = {

}

export default function ProjectList(){
    const projects = [
        {
            link: 'https://kcjhill1234.github.io/PasswordGenerator/',
            name: 'Password Generator',
            image: '/assets/images/password Gen screen shot.jpeg',
            date: 'April 13, 2020',
            description: 'This is a password generator that will create a random password.'
        }
    ].map(project => <Project {...project}/>)


    return (
        <div style={projectListStyles}>
            <h1>Project List</h1>
        </div>
    )
}
